import React from "react";

export const Messages = ({messages, form}) => {

    const messageClassName = 'message';

    console.log(form.user === messages.user)

    return(
        <div className={`${messageClassName} bg-light my-2 w-25`}>
            <p className='text-primary mx-2 my-2'>{messages.user}</p>
            <div className=''>
                {messages.title}
            </div>
            <div className='text-end'>
           {messages.date}
            </div>
        </div>
    )
}
